MP8_vdd_map = {
    0.60: vdd_600,
    0.65: vdd_650,
    0.70: vdd_700,
    0.75: vdd_750,
    0.80: vdd_800,
    0.85: vdd_850,
    0.90: vdd_900
}



def vdd_vbody_to_delay_power(vdd, vbody, lookup_error=False):
    if vbody < vdd:
        raise ValueError("vbody can not be less than vdd")
    
    vdd_lst = MP8_vdd_map.keys()
    if vdd not in vdd_lst:
        raise ValueError(f"invalid vdd, valid list: {vdd_lst}")
    
    delay_power = MP8_vdd_map[vdd]
    for body_i, delay_i, power_i in delay_power:
        if(body_i >= vbody):
            delay = delay_i
            if delay < 20:
                delay *= 1000
            power = power_i

            return (delay, power)
    
    if lookup_error:
        raise LookupError("excessive body voltage for this vdd")
    return False



